import React from 'react'

export default function ContactForm() {
    return (
        <form action="/">
            <input type="text" placeholder="Nom" />
            <input type="text" placeholder="Titre" />
            <input type="textarea" placeholder="Message" />
            captcha
        </form>
    )
}
